import React from 'react'
import TextField from '@mui/material/TextField';
import AccountCircle from '@mui/icons-material/AccountCircle';
import InputAdornment from '@mui/material/InputAdornment';
import {styled} from '@mui/material/styles'

import './style.css'

const CssTextField = styled(TextField)({
    // '& label.Mui-focused': {
    //   color: 'green',
    // },
    // '& .MuiInput-underline:after': {
    //   borderBottomColor: 'green',
    // },
    '& .MuiOutlinedInput-root': {
      '& fieldset': {
        borderColor: 'red',
      },
      '&:hover fieldset': {
        borderColor: 'yellow',
      },
    //   '&.Mui-focused fieldset': {
    //     borderColor: 'green',
    //   },
    },
  });
const Settings = () => {
    

    return (
        <>
            <h1>Questions</h1>
           
            <form>
                <TextField
                    id="username"
                    label="Username"
                    InputProps={{
                        startAdornment: (
                            <InputAdornment position="start">
                                <AccountCircle />
                            </InputAdornment>
                        ),
                    }}
                    variant="standard"
                    margin="normal"
                />
                 <CssTextField label="Custom CSS" id="custom-css-outlined-input" />
                <TextField
                    id="categories"
                    color="secondary"
                    select
                    label="Select a category"
                    value='name'
                    margin= 'normal'

                ></TextField>
                 <CssTextField label="Custom CSS" id="custom-css-outlined-input" />
                <TextField
                    id="difficulties"
                    color="secondary"
                    select
                    label="Select a difficulty"
                    value='difficulty'
                    margin="normal"

                ></TextField>
                <TextField
                    id="qtype"
                    color="secondary"
                    select
                    label="Select a type"
                    value='type'
                    margin="normal"

                ></TextField>
            </form>
        </>
    )
};
export default Settings
